      "texts": [
        {
          "english": "Culture is a meaning for people's 'way of life'.",
          "turkish": "Kültür, insanların yaşam biçimlerinin bir anlamıdır."
        },
        {
          "english": "Different groups of people may have different cultures.",
          "turkish": "Farklı insan gruplarının farklı kültürleri olabilir."
        },
        {
          "english": "A culture is passed on to the next generation by learning, whereas genetics are passed on by heredity.",
          "turkish": "Bir kültür öğrenerek bir sonraki nesle aktarılırken, genetik yapı kalıtım yoluyla geçer."
        },
        {
          "english": "Culture is seen in people's writing, religion, music, clothes, cooking, and in what they do.",
          "turkish": "Kültür, insanların yazılarında, dinlerinde, müziğinde, kıyafetlerinde, yemeklerinde ve yaptıkları şeylerde görülür."
        },
        {
          "english": "The concept of culture is very complicated, and the word has many meanings.",
          "turkish": "Kültür kavramı çok karmaşıktır ve kelimenin birçok anlamı vardır."
        },
        {
          "english": "Most broadly, 'culture' includes all human phenomena which are not purely results of human genetics.",
          "turkish": "En genel anlamda, 'kültür', insan genetiğinin tamamen sonucu olmayan tüm insan olaylarını içerir."
        },
        {
          "english": "Finally, the discipline which investigates cultures is called anthropology.",
          "turkish": "Son olarak, kültürleri araştıran bilim dalına antropoloji denir."
        }
      ],
